import React from 'react';
import { Link } from 'react-router-dom';

function PageTitle({ titleText, onClick, link }) {
    return (
        <div className='page-title' style={{color:"black"}}>
            <img src='./UI/UI_X.png' style={{height:"20px", position: "relative", left: "0"}} alt="Page Icon" />

            {onClick ? (
                <button onClick={onClick}>
                    OnClick Test Text
                </button>
            ) : link ? (
                <Link to={link}>
                    Link Test Text
                </Link>
            ) : null}

            <h1>{titleText}</h1>
        </div>
    );
}

export default PageTitle;
